import React from 'react';
import './css/sidebar.css'
import ExpandMoreIcon from '@material-ui/icons/ExpandMore'

const Sidebar = () => {
    return (
        <div className="sidebar">
            <div className="sidebar__top">
                <h2>Ace Dev</h2>
                <ExpandMoreIcon />
            </div>
        </div>
    );
}

export default Sidebar;
